		let url = apiAdr.concat(encodeURIComponent(ret.rooms_address));
		return getLatLon(url).then((response) => {
			ret.rooms_lat = response[0];
			ret.rooms_lon = response[1];
			return ret;
		});
	} else {
		return false;
	}
