			let columnsSet = new Set(optionsCheckGroups);
			optionsCheckGroups = Array.from( columnsSet );
			columns = columns.concat(optionsCheckGroups);
		}
		return obj.apply(keys, query, columns, results, APPLY, groupSplit);
	}

